    <script src="https://cdnjs.cloudflare.com/ajax/libs/Chart.js/3.9.1/chart.min.js"></script>
    <style>
        * {
            margin: 0;
            padding: 0;
            box-sizing: border-box;
        }

        body {
            font-family: -apple-system, BlinkMacSystemFont, 'Segoe UI', Roboto, 'Helvetica Neue', Arial, sans-serif;
            background: linear-gradient(135deg, #667eea 0%, #764ba2 100%);
            min-height: 100vh;
            padding: 20px;
        }

        .container {
            max-width: 1600px;
            margin: 0 auto;
        }

        .header {
            background: rgba(255, 255, 255, 0.98);
            border-radius: 20px;
            padding: 30px;
            margin-bottom: 30px;
            box-shadow: 0 10px 40px rgba(0, 0, 0, 0.1);
        }

        .header h1 {
            color: #2d3748;
            font-size: 2.5rem;
            margin-bottom: 10px;
            font-weight: 700;
        }

        .date-range {
            color: #718096;
            font-size: 1.1rem;
            font-weight: 500;
        }

        .filters {
            background: rgba(255, 255, 255, 0.98);
            border-radius: 15px;
            padding: 20px;
            margin-bottom: 30px;
            box-shadow: 0 10px 40px rgba(0, 0, 0, 0.1);
            display: flex;
            gap: 20px;
            flex-wrap: wrap;
            align-items: center;
        }

        .filter-group {
            display: flex;
            flex-direction: column;
            gap: 5px;
        }

        .filter-group label {
            color: #4a5568;
            font-size: 0.9rem;
            font-weight: 600;
            text-transform: uppercase;
            letter-spacing: 0.5px;
        }

        .filter-group select {
            padding: 10px 15px;
            border: 2px solid #e2e8f0;
            border-radius: 8px;
            font-size: 1rem;
            background: white;
            cursor: pointer;
            transition: all 0.3s ease;
            min-width: 200px;
        }

        .filter-group select:hover {
            border-color: #667eea;
        }

        .filter-group select:focus {
            outline: none;
            border-color: #667eea;
            box-shadow: 0 0 0 3px rgba(102, 126, 234, 0.1);
        }

        .metrics-grid {
            display: grid;
            grid-template-columns: repeat(auto-fit, minmax(280px, 1fr));
            gap: 25px;
            margin-bottom: 30px;
        }

        .metric-card {
            background: rgba(255, 255, 255, 0.98);
            border-radius: 15px;
            padding: 25px;
            box-shadow: 0 10px 40px rgba(0, 0, 0, 0.1);
            transition: transform 0.3s ease, box-shadow 0.3s ease;
        }

        .metric-card:hover {
            transform: translateY(-5px);
            box-shadow: 0 15px 50px rgba(0, 0, 0, 0.15);
        }

        .metric-label {
            color: #718096;
            font-size: 0.85rem;
            font-weight: 600;
            text-transform: uppercase;
            letter-spacing: 0.5px;
            margin-bottom: 8px;
        }

        .metric-value {
            color: #2d3748;
            font-size: 2rem;
            font-weight: 700;
            margin-bottom: 5px;
        }

        .metric-subvalue {
            color: #a0aec0;
            font-size: 0.9rem;
        }

        .chart-grid {
            display: grid;
            grid-template-columns: repeat(auto-fit, minmax(500px, 1fr));
            gap: 30px;
            margin-bottom: 30px;
        }

        .chart-card {
            background: rgba(255, 255, 255, 0.98);
            border-radius: 15px;
            padding: 25px;
            box-shadow: 0 10px 40px rgba(0, 0, 0, 0.1);
        }

        .chart-title {
            color: #2d3748;
            font-size: 1.3rem;
            font-weight: 600;
            margin-bottom: 20px;
            padding-bottom: 10px;
            border-bottom: 2px solid #e2e8f0;
        }

        .table-container {
            background: rgba(255, 255, 255, 0.98);
            border-radius: 15px;
            padding: 25px;
            box-shadow: 0 10px 40px rgba(0, 0, 0, 0.1);
            margin-bottom: 30px;
            overflow-x: auto;
        }

        table {
            width: 100%;
            border-collapse: collapse;
        }

        th {
            background: #f7fafc;
            color: #4a5568;
            font-weight: 600;
            text-align: left;
            padding: 15px;
            font-size: 0.85rem;
            text-transform: uppercase;
            letter-spacing: 0.5px;
            border-bottom: 2px solid #e2e8f0;
            position: sticky;
            top: 0;
            z-index: 10;
        }

        td {
            padding: 12px 15px;
            border-bottom: 1px solid #e2e8f0;
            color: #2d3748;
        }

        tr:hover {
            background: #f7fafc;
        }

        .creator-link {
            color: #667eea;
            text-decoration: none;
            font-weight: bold;
            transition: all 0.2s ease;
        }

        .creator-link:hover {
            color: #764ba2;
            text-decoration: underline;
        }

        .badge {
            display: inline-block;
            padding: 4px 10px;
            border-radius: 12px;
            font-size: 0.8rem;
            font-weight: 600;
        }

        .badge-catakor { background: #fef3c7; color: #92400e; }
        .badge-jiyu { background: #ddd6fe; color: #5b21b6; }
        .badge-pc { background: #fed7aa; color: #9a3412; }
        .badge-peach { background: #fce7f3; color: #9f1239; }
        .badge-yerba { background: #d1fae5; color: #065f46; }

        .activity-indicator {
            display: inline-block;
            width: 8px;
            height: 8px;
            border-radius: 50%;
            margin-right: 5px;
        }

        .high-activity { background: #10b981; }
        .medium-activity { background: #f59e0b; }
        .low-activity { background: #ef4444; }

        canvas {
            max-height: 400px;
        }
    </style>
</head>
<body>
    <div class="container">
        <div class="header">
            <h1>Creator Performance Dashboard</h1>
            <div class="date-range">November 16-22, 2024 | All Brands</div>
        </div>

        <div class="filters">
            <div class="filter-group">
                <label>Brand Filter</label>
                <select id="brandFilter">
                    <option value="all">All Brands</option>

        let allData = [];
        let filteredData = [];
        let charts = {};

        // Process embedded data
        allData = rawData.map(row => ({
            brand: row.b,
            creator: row.c,
            gmv: parseFloat(row.g.replace(/[$,]/g, '') || 0),
            refunds: parseFloat(row.r.replace(/[$,]/g, '') || 0),
            orders: parseInt(row.o || 0),
            itemsSold: parseInt(row.i || 0),
            itemsRefunded: parseInt(row.ir || 0),
            aov: parseFloat(row.a.replace(/[$,]/g, '') || 0),
            avgDailyProducts: parseFloat(row.ap || 0),
            videos: parseInt(row.v || 0),
            lives: parseInt(row.l || 0),
            commission: parseFloat(row.ec.replace(/[$,]/g, '') || 0),
            samplesShipped: parseInt(row.ss || 0),
            flatFee: parseFloat(row.ef.replace(/[$,]/g, '') || 0),
            totalPosts: parseInt(row.v || 0) + parseInt(row.l || 0)
        }));

        filteredData = [...allData];

        function initializeDashboard() {
            updateMetrics();
            createCharts();
            updateTopCreatorsTable();
        }

        function setupEventListeners() {
            document.getElementById('brandFilter').addEventListener('change', applyFilters);
            document.getElementById('gmvFilter').addEventListener('change', applyFilters);
            document.getElementById('activityFilter').addEventListener('change', applyFilters);
        }

        function applyFilters() {
            const brandFilter = document.getElementById('brandFilter').value;
            const gmvFilter = document.getElementById('gmvFilter').value;
            const activityFilter = document.getElementById('activityFilter').value;

            filteredData = allData.filter(row => {
                if (brandFilter !== 'all' && row.brand !== brandFilter) return false;

                if (gmvFilter !== 'all') {
                    if (gmvFilter === '10000+' && row.gmv < 10000) return false;
                    if (gmvFilter === '5000-10000' && (row.gmv < 5000 || row.gmv >= 10000)) return false;
                    if (gmvFilter === '1000-5000' && (row.gmv < 1000 || row.gmv >= 5000)) return false;
                    if (gmvFilter === '0-1000' && row.gmv >= 1000) return false;
                }

                if (activityFilter !== 'all') {
                    if (activityFilter === 'high' && row.totalPosts < 10) return false;
                    if (activityFilter === 'medium' && (row.totalPosts < 5 || row.totalPosts >= 10)) return false;
                    if (activityFilter === 'low' && (row.totalPosts === 0 || row.totalPosts >= 5)) return false;
                    if (activityFilter === 'none' && row.totalPosts > 0) return false;
                }

                return true;
            });

            updateMetrics();
            updateCharts();
            updateTopCreatorsTable();
        }

        function updateMetrics() {
            const totalGMV = filteredData.reduce((sum, row) => sum + row.gmv, 0);
            const totalOrders = filteredData.reduce((sum, row) => sum + row.orders, 0);
            const totalVideos = filteredData.reduce((sum, row) => sum + row.videos, 0);
            const totalLives = filteredData.reduce((sum, row) => sum + row.lives, 0);
            const totalCreators = filteredData.length;
            const avgGMVPerCreator = totalCreators > 0 ? totalGMV / totalCreators : 0;

            const activeCreators = filteredData.filter(row => row.totalPosts > 0).length;
            const highPerformers = filteredData.filter(row => row.gmv >= 10000).length;

            const metricsHTML = `
                <div class="metric-card">
                    <div class="metric-label">Total GMV</div>
                    <div class="metric-value">$${totalGMV.toLocaleString('en-US', {minimumFractionDigits: 0, maximumFractionDigits: 0})}</div>
                    <div class="metric-subvalue">${totalCreators.toLocaleString()} creators</div>
                </div>
                <div class="metric-card">
                    <div class="metric-label">Total Orders</div>
                    <div class="metric-value">${totalOrders.toLocaleString()}</div>
                    <div class="metric-subvalue">Avg ${(totalOrders/totalCreators).toFixed(0)} per creator</div>
                </div>
                <div class="metric-card">
                    <div class="metric-label">Total Content</div>
                    <div class="metric-value">${(totalVideos + totalLives).toLocaleString()}</div>
                    <div class="metric-subvalue">${totalVideos.toLocaleString()} videos, ${totalLives.toLocaleString()} lives</div>
                </div>
                <div class="metric-card">
                    <div class="metric-label">Active Creators</div>
                    <div class="metric-value">${activeCreators}</div>
                    <div class="metric-subvalue">${((activeCreators/totalCreators)*100).toFixed(1)}% posted content</div>
                </div>
                <div class="metric-card">
                    <div class="metric-label">Avg GMV/Creator</div>
                    <div class="metric-value">$${avgGMVPerCreator.toLocaleString('en-US', {minimumFractionDigits: 0, maximumFractionDigits: 0})}</div>
                    <div class="metric-subvalue">Per active creator</div>
                </div>
                <div class="metric-card">
                    <div class="metric-label">High Performers</div>
                    <div class="metric-value">${highPerformers}</div>
                    <div class="metric-subvalue">$10K+ GMV creators</div>
                </div>
            `;

            document.getElementById('metricsGrid').innerHTML = metricsHTML;
        }

        function createCharts() {
            // GMV by Brand Chart
            const brandGMV = {};
            filteredData.forEach(row => {
                if (!brandGMV[row.brand]) brandGMV[row.brand] = 0;
                brandGMV[row.brand] += row.gmv;
            });

            const ctx1 = document.getElementById('gmvByBrandChart').getContext('2d');
            if (charts.gmvByBrand) charts.gmvByBrand.destroy();
            charts.gmvByBrand = new Chart(ctx1, {
                type: 'bar',
                data: {
                    labels: Object.keys(brandGMV),
                    datasets: [{
                        label: 'GMV',
                        data: Object.values(brandGMV),
                        backgroundColor: [
                            'rgba(251, 191, 36, 0.8)',
                            'rgba(139, 92, 246, 0.8)',
                            'rgba(251, 146, 60, 0.8)',

                            'rgba(34, 197, 94, 0.8)'
                        ],
                        borderColor: [
                            'rgba(251, 191, 36, 1)',

                            'rgba(236, 72, 153, 1)',
                            'rgba(34, 197, 94, 1)'
                        ],
                        borderWidth: 2
                    }]
                },
                options: {
                    responsive: true,
                    maintainAspectRatio: false,
                    plugins: {
                        legend: { display: false },

                                    return '$' + context.parsed.y.toLocaleString('en-US', {minimumFractionDigits: 0, maximumFractionDigits: 0});
                                }
                            }
                        }
                    },
                    scales: {
                        y: {
                            beginAtZero: true,
                            ticks: {
                                callback: function(value) {
                                    return '$' + (value/1000).toFixed(0) + 'K';
                                }
                            }
                        }
                    }
                }
            });

            // Activity Distribution Chart
            const activityBuckets = {
                'No Posts': 0,
                '1-4 Posts': 0,
                '5-9 Posts': 0,
                '10-19 Posts': 0,
                '20+ Posts': 0
            };

            filteredData.forEach(row => {
                if (row.totalPosts === 0) activityBuckets['No Posts']++;
                else if (row.totalPosts <= 4) activityBuckets['1-4 Posts']++;
                else if (row.totalPosts <= 9) activityBuckets['5-9 Posts']++;
                else if (row.totalPosts <= 19) activityBuckets['10-19 Posts']++;
                else activityBuckets['20+ Posts']++;
            });

            const ctx2 = document.getElementById('activityDistributionChart').getContext('2d');
            if (charts.activityDistribution) charts.activityDistribution.destroy();
            charts.activityDistribution = new Chart(ctx2, {

                        ],
                        borderWidth: 2
                    }]
                },
                options: {
                    responsive: true,
                    maintainAspectRatio: false,
                    plugins: {
                        legend: {
                            position: 'bottom'
                        },
                        tooltip: {
                            callbacks: {
                                label: function(context) {
                                    const total = context.dataset.data.reduce((a, b) => a + b, 0);
                                    const percentage = ((context.parsed / total) * 100).toFixed(1);
                                    return context.label + ': ' + context.parsed + ' (' + percentage + '%)';
                                }
                            }
                        }
                    }
                }
            });

            // GMV vs Activity Correlation
            const correlationData = filteredData
                .filter(row => row.totalPosts > 0)
                .sort((a, b) => b.gmv - a.gmv)
                .slice(0, 100);

            const ctx3 = document.getElementById('gmvActivityCorrelation').getContext('2d');
            if (charts.correlation) charts.correlation.destroy();
            charts.correlation = new Chart(ctx3, {
                type: 'scatter',
                data: {

                            x: row.totalPosts,
                            y: row.gmv,

            // AOV by Brand Chart
            const brandAOV = {};

            filteredData.forEach(row => {
                if (!brandAOV[row.brand]) {
                    brandAOV[row.brand] = 0;
                    brandCounts[row.brand] = 0;
                }
                if (row.aov > 0) {
                    brandAOV[row.brand] += row.aov;
                    brandCounts[row.brand]++;
                }
            });

            Object.keys(brandAOV).forEach(brand => {
                if (brandCounts[brand] > 0) {
                    brandAOV[brand] = brandAOV[brand] / brandCounts[brand];

        function updateTopCreatorsTable() {
            const sortedData = [...filteredData].sort((a, b) => b.gmv - a.gmv).slice(0, 50);
            
            let tableHTML = '';
            sortedData.forEach((row, index) => {
                const activityLevel = getActivityLevel(row.totalPosts);
                const badgeClass = getBrandBadgeClass(row.brand);
                const activityClass = getActivityClass(row.totalPosts);
                
                tableHTML += '<tr>';
                tableHTML += '<td>' + (index + 1) + '</td>';
                tableHTML += '<td><a href="https://www.tiktok.com/@' + row.creator + '" target="_blank" class="creator-link">' + row.creator + '</a></td>';
                tableHTML += '<td><span class="badge ' + badgeClass + '">' + row.brand + '</span></td>';
                tableHTML += '<td><strong>$' + row.gmv.toLocaleString('en-US', {minimumFractionDigits: 2, maximumFractionDigits: 2}) + '</strong></td>';
                tableHTML += '<td>' + row.orders.toLocaleString() + '</td>';
                tableHTML += '<td>$' + row.aov.toFixed(2) + '</td>';
                tableHTML += '<td>' + row.videos + '</td>';
                tableHTML += '<td>' + row.lives + '</td>';
                tableHTML += '<td><strong>' + row.totalPosts + '</strong></td>';
                tableHTML += '<td><span class="activity-indicator ' + activityClass + '"></span>' + activityLevel + '</td>';
                tableHTML += '</tr>';
            });

            document.getElementById('topCreatorsBody').innerHTML = tableHTML || '<tr><td colspan="10" style="text-align: center;">No data to display</td></tr>';
        }

        function getActivityLevel(posts) {
            if (posts === 0) return 'No Activity';
            if (posts <= 4) return 'Low';
            if (posts <= 9) return 'Medium';
            return 'High';
        }

        function getBrandBadgeClass(brand) {
            const brandClasses = {
                'Cata-Kor': 'badge-catakor',
                'JiYu': 'badge-jiyu',
                'PC': 'badge-pc',
                'Peach Slices': 'badge-peach',
                'Yerba Magic': 'badge-yerba'
            };
            return brandClasses[brand] || '';
        }

        function getActivityClass(posts) {
            if (posts === 0) return '';
            if (posts <= 4) return 'low-activity';
            if (posts <= 9) return 'medium-activity';
            return 'high-activity';
        }

        // Initialize on page load
        window.addEventListener('DOMContentLoaded', () => {
            initializeDashboard();
            setupEventListeners();
        });
    </script>
</body>
</html>
